?><p style="text-align: justify;"><span style="font-size: medium;"><span style="font-family: Times New Roman;">Louis Vuitton это не просто известнейшая компания, это один из самых старинных домов моды. Ее основатель Луи Виттон родился в небольшом городке, под названием Юра, в 1821 году. Когда ему исполнилось 14 лет, он, полный решимости, направился в Париж, причем, без единого гроша в кармане. В Париже Луи Виттон зря времени не терял, он сразу же стал обучаться столярному делу. И он настолько успешно занимался этим ремеслом, что вскоре, был назначен столяром Евгении де Монтихо (жена Наполеона 3-го). После этого, он обзавелся связями среди парижской элиты. И при помощи этих связей, в 1853 году, он открывает свою собственную столярную мастерскую. Интересно, что первое изобретение, произведенное Луи Виттоном в этой мастерской, был обыкновенный плоский чемодан (дата изобретения 1858 год). Но это, вроде бы обычное изобретение, принесло Луи Виттону всемирную популярность. Вскоре, в 1914 году, был открыт первый бутик компании. Причем, сразу же после открытия первого, были открыты и вторые, и третьи в различных странах мира. Компания специализируется на выпуске продукции исключительно ручной работы. На данный момент, компания производит не только элитные ювелирные украшения, но также и роскошные часы. Купить часы компании можно исключительно в специализированных бутиках. Оригинальный дизайн, известность бренда, надежность вот те параметры, по которым выбирают часы Louis Vuitton. </span></span></p>
 
